import React from 'react';
import HomeNavBar from './Components/HomeNavBar'
import HomeCarrousel from './Components/HomeCarousel';


const HomePage = () => (
    
    
    <div>
        <header><HomeNavBar/></header>
        <div>
            <HomeCarrousel></HomeCarrousel>
        </div>        
    </div>
    );
    
    
    export default HomePage;
